/* bgN */
function bgN(number, power) {
  return ethers.utils.parseUnits(number.toString(), power);
}

/* numberWithCommas */
function nWC(x) {
  return x.toString().replace(/\B(?=(\d{3})+(?!\d))/g, ",");
}

